description:
The Alex Jones Show

Thursday January 08, 2009.

Alex welcomes back to the show author, former professional football player, reporter, television sports presenter, and former spokesman for the Green Party, David Icke. David will talk with Alex about the &quot;naked emperor,&quot; Barack Obama. Other guests include the host of the &quot;Q-Files&quot; radio program, Steve Quayle, and economist, nationally syndicated columnist, and former Assistant Secretary of the Treasury in the Reagan Administration, Paul Craig Roberts. Alex also discusses breaking news and takes your calls. 

Hour-1: News then Steve Quayle
Hour-2: Steven Quayle then Paul Craig Roberts
Hour-3: David Icke
Hour-4: David Icke
